import React, { Component } from "react";
import NavComponent from "./navcomponent";

class VideoComponent extends Component {
  constructor(props) {
    super(props);
    this.apiUrl = `https://tiktoktv.artefaktas.workers.dev/api`;
    this.state = {
      data: null,
    };
    this.settings = {
      title: `TikTok videos`,
      errorMessage: `Šiuo metu vaizdo įrašų nėra`,
    };
  }

  componentDidMount() {
    const fetchLink = this.apiUrl;
    async function getVideos() {
      const res = await fetch(fetchLink);
      const jsonData = await res.json();
      return jsonData;
    }

    getVideos().then((jsonData) => {
      this.setState({ data: jsonData });
    });
  }

  render() {
    return (
      <div>
        <div className="col-lg-10 col-md-10 col-sm-12 col-xs-12 mx-auto align-items-center">
          <div className="card my-4">
            <div className="card-body">
              <h4 className="card-title">{this.settings.title}</h4>
              <p>
                {this.state.data !== null && this.state.data.length > 0
                  ? "Gotcha"
                  : this.settings.errorMessage}
              </p>
            </div>
          </div>
        </div>
        <NavComponent />
      </div>
    );
  }
}

export default VideoComponent;
